const PostItem = () =>{
    return(
        <div className={cx('post-item')}>
            <h2><a>타이틀</a></h2>
            <div className={cx('date')}>2020-06-12</div>
            <p>내용</p>
            <div className={cx('tags')}>
                <a>#태그</a>
                <a>#태그</a>
                <a>#태그</a>
            </div>
        </div>
    )
}

const PostList =() =>{
    return(
        <div className={cx('post-list')}>
            <PostItem />
            <PostItem />
            <PostItem />
            <PostItem />
            <PostItem />
            <PostItem />
            <PostItem />
        </div>
    )
}

export default PostList;
